Correct image path to display image properly on front-end in Express React (create-react-app)<p>The answer to this problem is probably very simple, I hope.</p>

<p>So I'm creating an app based on MongoDB, Node, Express, React and so on, but I can't figure out how to properly setup and display user's avatar after he uploads it.</p>

<p>I have a ready API endpoint for uploading avatar, which when hit with request successfully uploads an image. (with multer middleware help) I'm also storing it in MongoDB properly. The thing is it currently looks like this and I'm pretty sure it shouldn't:</p>

<p>In Redux state:</p>

<pre><code>avatar(pin): "C:\Users\Kuba\Desktop\mern_project\client\public\avatars\uploads\profileAvatar-1558374898723.jpeg"
</code></pre>

<p>So how should the path to uploaded image look like so I can successfully display it in React (built with create-react-app if that's of any help). In which folder should I store uploaded images?</p>

<p>That is my default avatar path which works pretty well, but it was simply implemented by import in React component.</p>

<pre><code>avatar(pin): "/static/media/template-avatar2.173d1842.svg"
</code></pre>

<p><a href="https://i.stack.imgur.com/1yLRh.png" rel="nofollow noreferrer">Project structure image</a></p>

<p>Client is the frontend, API endpoint in routes/api/profile.js</p>

<p>I appreciate any help.</p>

<p>Below is the route</p>

<pre><code>  router.post(
  "/avatar",
  passport.authenticate("jwt", { session: false }),
  upload.single("avatar"),
  (req, res) =&gt; {
    const errors = {};

// Path to the avatar is in req.file.path
if (!req.file.path) {
  errors.avatar = "Wrong file format";
  return res.status(404).json(errors);
}
const avatarPath = req.file.path;

Profile.findOne({ user: req.user.id })
  .then(profile =&gt; {
    if (profile) {
      Profile.findOneAndUpdate(
        { user: req.user.id },
        { $set: { avatar: avatarPath } },
        { new: true }
      )
        .then(profile =&gt; {
          res.json(profile);
        })
        .catch(err =&gt; res.json(err));
    } else {
      errors.noprofile = "Couldn't find the profile";
      res.status(404).json(errors);
    }
    errors.noprofile = "Couldn't find the profile";
  })
  .catch(err =&gt; res.status(404).json(errors));
</code></pre>

<p>}
);</p>

<p>Multer settings</p>

<pre><code>const multer = require("multer");

const storage = multer.diskStorage({
  destination: (req, file, cb) =&gt; {
    cb(null, "./client/src/img/uploads/avatars");
  },
  filename: (req, file, cb) =&gt; {
    cb(
      null,
      file.fieldname + "-" + file.filename + "." + file.mimetype.slice(6)
    );
  }
});

const fileFilter = (req, file, cb) =&gt; {
  if (file.mimetype === "image/jpeg" || file.mimetype === "image/png")
    cb(null, true);
  else {
    // reject a file
    let errors = {};
    cb(
      new Error(
        (errors.avatar = "Wrong filetype, only png and jpg types are eligible")
      ),
      false
    );
  }
};

// Upload avatar middleware
const upload = multer({
  storage,
  limits: {
    fileSize: 1024 * 1024 * 2
  },
  fileFilter
});
</code></pre>

<p>EDIT: Okay I changed the path in Multer to relative one, looks like this now, still doesn't work. </p>

<pre><code>avatar(pin): "client\src\img\uploads\avatars\avatar-undefined.png"
</code></pre>

