How can I update image in edit view in laravel?<p>In laravel I have a field in my edit view named Profile Picture, whenever I click On edit button I got all the values from database in edit view but I don't get image, And If whenever I click on submit button everytime I have to upload image without that I can't process further I want If I not upload new image then form will automatic consider old profile pic</p>

<p>my blade file is like</p>

<pre><code>&lt;div class="col-md-6"&gt;
    &lt;div class="form-group"&gt;
        &lt;label for="photo"&gt;Profile Picture :&lt;span class="danger"&gt;*&lt;/span&gt; &lt;/label&gt;
