                    @endif
                @endforeach
            &lt;/div&gt;
        &lt;/div&gt;
    &lt;/div&gt;
&lt;/div&gt;
</code></pre>

<p>Controller File</p>

<pre><code> public function updateEmployee(Request $request, $id)
    {
        $employee = User::find($id);
        //Get inputs for personal detail
        $firstName = $request-&gt;get('firstName');
