embedfield:
I want to know how to pass values after doing a rest api function, without storing data in MongDB<p>I get details from user and call a rest api function and validate that details. But after that I need to pass the all details to payment page without storing values in my MongoDB. After the payment is successful those details need to be stored.</p>

<p>I am implementing frontend using react and html. I take telephone number and identity card number as valuable data. When I press the submit button the system will validate the user and show the output in the next page. I want to pass the telephone number and identity card number to next page without storing it in a mongodb.</p>

<pre><code>render() {
    return &lt;div className="container card"&gt;
        &lt;div className="card-body"&gt;
            &lt;h4 className="card-title"&gt;Buyer Details&lt;/h4&gt;
            &lt;h6 className="card-subtitle mb-2 text-muted"&gt;We offer a discount for Government Employees by using your NIC number &lt;/h6&gt;&lt;br/&gt;
        &lt;form&gt;
            &lt;div className="row"&gt;
                &lt;div className="col-md-4 form-group"&gt;
                    &lt;label htmlFor="name"&gt;First Name*&lt;/label&gt;
                    &lt;input type="text" className="form-control" id="fname" maxLength={100} placeholder="First Name" required/&gt;
                &lt;/div&gt;
                &lt;div className="col-md-4 form-group"&gt;
                    &lt;label htmlFor="name"&gt;Last Name*&lt;/label&gt;
                    &lt;input type="text" className="form-control" id="lname" maxLength={100} placeholder="Last Name" required/&gt;
                &lt;/div&gt;
