Mongodb aggregation lookup query - return all sub-documents<p>Following on from <a href="https://stackoverflow.com/questions/56236725/mongo-lookup-filter-using-nested-query">this</a> question, I am hoping to filter a list of parent documents, based upon values in associated child documents.</p>

<p>Given the following mongoDB collections....</p>

<pre class="lang-js prettyprint-override"><code>    // 'job' collection
    {
      "id"      : j1,
      "mediaID" : "ABC1234"
    },
    {
      "id"      : j2,
      "mediaID" : "DEF1234"
    }
</code></pre>

<p>..and..</p>

<pre class="lang-js prettyprint-override"><code>    // 'task' collection

    // j1 tasks
    {
      "id"      : "t1",
      "job"     : "j1",
      "taskName": "MOVE",
      "status"  : "COMPLETE"
    },
    {
      "id"      : "t2",
      "job"     : "j1",
      "taskName": "PUBLISH",
      "status"  : "FAILED"
    },
    // j2 tasks
    {
      "id"      : "t3",
      "job"     : "j2",
      "taskName": "MOVE",
      "status"  : "COMPLETE"
    },
    {
      "id"      : "t4",
      "job"     : "j2",
      "taskName": "PUBLISH",
      "status"  : "COMPLETE"
    }
</code></pre>

<p>..where the task collection links to the job collection via job.id -> task.job</p>

<p>I have an aggregate query which will filter <code>job</code> collection based upon criteria in child collection. I am using the pipeline syntax of Mongo's <code>$lookup</code> and have a query something like this....</p>

<pre class="lang-js prettyprint-override"><code>db.getCollection("job").aggregate(
  [
    {

      "$lookup": {
        "from"    : "task",
        "let"     : {
          "job_id": "$_id"
        },
        "pipeline": [
          {
            "$match": {
              "$expr": {
                "$and": [
                  {
                    // link job.id to task.job
                    "$eq": ["$job", "$$job_id"]
                  },
                  {
                    // Filter taskName
                    "$eq": ["$taskName", "PUBLISH"]
                  },
                  {
                    // Filter by status
                    "$eq": ["$status", "FAILED"]
                  }
                ]
              }
            }
          }
        ],
        "as"      : "tasks"
      }
    },
    {
      // Remove ROOT docs that do not meet 'task' criteria
      "$match": {
        "tasks": {"$ne": []}
      }
    }
  ]
);
</code></pre>

<p>This works just fine, except that I would like <em>all</em> sub-documents of a parent returned in the results, not just the one that matched. </p>

<p>For example, the above query gives me this...</p>

<pre class="lang-js prettyprint-override"><code>  {
     "id"      : j1,
     "mediaID" : "ABC1234"
     "tasks" : [
         {
           "id"      : "t2",
           "job"     : "j1",
           "taskName": "PUBLISH",
           "status"  : "FAILED"
      },
     ]
   },
</code></pre>

<p>..but I would like this...</p>

<pre class="lang-js prettyprint-override"><code>  {
     "id"      : j1,
     "mediaID" : "ABC1234"
     "tasks" : [
         {
           "id"      : "t1",
           "job"     : "j1",
           "taskName": "MOVE",
           "status"  : "COMPLETE"
         },
         {
           "id"      : "t2",
           "job"     : "j1",
           "taskName": "PUBLISH",
           "status"  : "FAILED"
      },
     ]
   },
</code></pre>

<p>I have an inking I would need to use <code>$push</code> at some point, but am stumped! Any help appreciated.</p>

