Upsert ref documents when pushing to array in Express<p>I have a <code>Candidate</code> schema with an array of refs to an <code>Endorser</code> schema. Like so:</p>

<pre><code>const CandidateSchema = new mongoose.Schema({
    name: {
        type: String,
        required: true,
        trim: true
    },
    endorsements: [{
        type: mongoose.Schema.Types.ObjectId,
        ref: 'Endorser'
    }]
});

const EndorserSchema = new mongoose.Schema({
    name: {
        type: String,
        required: true,
        trim: true
    },
});
</code></pre>

<p>I receive <code>endorsements</code> in the form of an array of strings (i.e., the endorser's name). I want to iterate through that array and retrieve the <code>_id</code> of each from the <code>Endorser</code> model or upsert a new one if it doesn't exist. I then want to push those refs onto the existing <code>candidate</code> instance.</p>

<p>The following code works, but I really don't feel comfortable modifying the <code>candidate</code> instance in-memory. Having to do the promise resolution separately also seems weird. </p>

<pre><code>    const endorsementPromises = endorsements.map(async endorser =&gt; {
        let endorserObj = await Endorser.findOneAndUpdate({name: endorser}, {name: endorser}, {upsert: true, new: true});
        return endorserObj._id;
    });
    const endorsementArray = await Promise.all(endorsementPromises);
    candidate.endorsements = candidate.endorsements.concat(endorsementArray);
    await candidate.save();
</code></pre>

<p>I have tried using <a href="https://docs.mongodb.com/manual/reference/method/db.collection.findOneAndUpdate/" rel="nofollow noreferrer"><code>findOneAndUpdate</code></a> with <a href="https://docs.mongodb.com/manual/reference/operator/update/push/" rel="nofollow noreferrer"><code>$push</code></a> and <a href="https://docs.mongodb.com/manual/reference/operator/update/each/" rel="nofollow noreferrer"><code>$each</code></a>. However, this only returns an error and doesn't update the document.</p>

<pre><code>Candidate.update(
        {id: candidate._id}, 
        {$push: {
            endorsements: {
                $each: endorsementArray
            }
        }}
    );
</code></pre>

<pre><code>// the error
Error: {"n":0,"nModified":0,"ok":1}
</code></pre>

<p>I'm not sure why <code>$push</code> and <code>$each</code> aren't updating the document.</p>

<p>Any guidance would be really appreciated.</p>

