Pass extra variable to callback function<p>I am trying to create a simple method that logs out my DB operation results in a prettified format in the console. I want to pass an extra variable (<code>operationName</code>) to my custom logger callback function when my DB finishes an operation.</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>// Custom logger (simplified)
const dbLogger = (error, data, operationName) =&gt; {
  if (error) {
    console.log(`${operationName} failed`, error)
  }
  console.log(`${operationName} success`, data)
}

// mongodb operations
import ChatModel from 'somewhere';

function createMessage() {
  const newChatAdded = new ChatModel({
    message: 'Hi'
  })
  ChatModel.save(newChatAdded, dbLogger);
}</code></pre>
